Mallorca is the kind of place that makes you a bit insufferable. The people are warm, the days feel infinite, the simplest meals make you say things like “I could die happy now” and “the Spaniards really do it right” 🦞. One boat trip 🛥️ will give you steadfast opinions about “floating in the Med” vs. any other body of water 🌊. Literally every single thing is sun-kissed 🌞. No one is overdressed nor underdressed 👗, and I didn’t see a single high heel, giving the entire island the subtle yet collective sense of comfort you can only identify by being so mysteriously relaxed 😌. 

📝 I cannot compute how many hours I spend researching places that hit the sensory trifecta of top tier food + vibes + comfort, but I have been told that my vacation itineraries are “better than paying a travel agent” 😉 so here we go: 

@ses.coves - This place needs its own dedicated post but just know that it is a must, and oddly you won’t find it on many other “must do” lists. It’s a low-key high-vibe restaurant set on top of one of the most magical mysterious caves I’ve ever seen. 

@caspatromarch - in Deia, fresh fish with an unbeatable view. A steep drive of hairpin turns plus a short hike to get to, making lunch all the more worth it. 

@belmondlaresidencia - Also in Deia, go after lunch for a coffee + Spanish cheese on the terrace for White Lotus level people watching. And it’s smack in the middle of the historic village, perfect for a gelato before siesta. 

@cap_rocat - If you can manage to snag a room (prices and weather is best in shoulder-season September) you may never leave the property. Luxury is built into a 130 year old castle, including a take-your-breath-away private swimming cove and a restaurant (with the life-changing paella) overlooking it all. 

@beachclub_granfolies @assaona - “Afternoons should be spent at beach clubs” is another eyerolling sentiment you will pick up after a week in the Balearic Islands. Sunbeds, saltwater, palapas, paella, friends and flowing cocktails… these are the reasons you come here.

